pragma solidity ^0.5.1;

contract TokenContract {
    address public owner;
    address private owner2;
    uint256 public totalsupply;
    mapping(address => mapping(address => uint256)) public allowance;
    mapping(address => uint256) public balanceof;
    uint256 private totalSupply2;
    uint256 public price;

    constructor() public payable {
        totalSupply2 = 0;
        price = 0x2faf0800;
        owner = msg.sender;
    }

    function approve(address _spender, uint256 _value) public {
        allowance[msg.sender][_spender] = _value;
    }

    function transferFrom(address _from, address _to, uint256 _value) public {
        require(_value <= balanceof[_from]);
        require(_value <= allowance[_from][msg.sender]);
        balanceof[_from] -= _value;
        balanceof[_to] += _value;
        allowance[_from][msg.sender] -= _value;
    }

    function changeOwner(address newOwner) public {
        require(msg.sender == owner);
        require(newOwner != address(0));
        owner2 = newOwner;
    }

    function confirmOwner() public {
        require(msg.sender == owner2);
        owner = owner2;
        owner2 = address(0);
    }

    function transfer(address _to, uint256 _value) public {
        require(_value <= balanceof[msg.sender]);
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
    }

    function() external payable {
        require(msg.value > 0);
        uint256 amount = msg.value / (10 * price / 8);
        require(balanceof[msg.sender] + amount > balanceof[msg.sender]);
        require(msg.value <= 0x8ac7230489e80000);
        require(amount > 0);
        totalsupply += amount;
        balanceof[msg.sender] += amount;
        if (msg.value % 100 == 0) {
            price = totalSupply2 / totalsupply;
            totalSupply2 = totalSupply2;
        } else {
            price = (85 * msg.value / 100 + totalSupply2) / totalsupply;
            totalSupply2 += 85 * msg.value / 100;
        }
    }
}
